import axios from "axios"
import { GET_ERRORS, FETCH_DATA } from "./types";

export const getBookings = bookingData => dispatch => {
    axios
      .post("http://localhost:5000/api/expert/bookings", bookingData)
      .then(res => {
        dispatch({
            type: FETCH_DATA,
            paylaod: res.data,
          })
      })
      .catch(err =>
        dispatch({
          type: GET_ERRORS,
          payload: err.response.data
        })
      );
  };


export const updateBooking = bookingData => dispatch => {
    axios
      .post("http://localhost:5000/api/expert/bookings", bookingData)
      .then(res => {
        dispatch({
            type: FETCH_SUCCESS,
            paylaod: res.data,
          })
      })
      .catch(err =>
        dispatch({
          type: GET_ERRORS,
          payload: err.response.data
        })
      );
  };
